"""**Gradient Descent and Linear Regression with PyTorch**

Dans ce tutoriel, nous aborderons l'un des algorithmes fondamentaux de l'apprentissage automatique : la régression linéaire. Nous allons créer un modèle qui prédit les rendements des cultures de pommes et d'oranges (variables cibles) en examinant la température moyenne, les précipitations et l'humidité (variables d'entrée ou caractéristiques) dans une région. Voici les données d'apprentissage :![image.png](data:image/png;base64,)

Dans un modèle de régression linéaire, chaque variable cible est estimée comme étant une somme pondérée des variables d'entrée, compensée par une certaine constante, appelée biais :

`yield_apple  = w11 * temp + w12 * rainfall + w13 * humidity + b1`

`yield_orange = w21 * temp + w22 * rainfall + w23 * humidity + b2`

Nous allons entraîner notre modèle en ajustant légèrement les poids plusieurs fois afin d'obtenir de meilleures prédictions, à l'aide d'une technique d'optimisation appelée descente de gradient. Commençons par importer Numpy et PyTorch.
"""

import numpy as np
import torch

"""**Training data**

Nous pouvons représenter les données d'apprentissage à l'aide de deux matrices : les entrées et les cibles, chacune comportant une ligne par observation et une colonne par variable.
"""

# Input (temp, rainfall, humidity)
inputs = np.array([[73, 67, 43],
                   [91, 88, 64],
                   [87, 134, 58],
                   [102, 43, 37],
                   [69, 96, 70]], dtype='float32')

# Targets (apples, oranges)
targets = np.array([[56, 70],
                    [81, 101],
                    [119, 133],
                    [22, 37],
                    [103, 119]], dtype='float32')

"""Nous avons séparé les variables d'entrée et les variables cibles parce que nous allons les traiter séparément. Nous avons également créé des tableaux numpy, car c'est typiquement la façon dont vous travaillez avec des données d'entraînement : lire des fichiers CSV en tant que tableaux numpy, effectuer quelques traitements, puis les convertir en tensors PyTorch.

Convertissons les tableaux en tensors PyTorch.


"""

# Convert inputs and targets to tensors
inputs = torch.from_numpy(inputs)
targets = torch.from_numpy(targets)
print(inputs)
print(targets)

"""**Linear regression model from scratch**

Les poids et les biais (`w11, w12,... w23, b1 & b2`) peuvent également être représentés sous forme de matrices, initialisées comme des valeurs aléatoires. La première ligne de `w` et le premier élément de `b` sont utilisés pour prédire la première variable cible, c'est-à-dire le rendement des pommes, et de la même manière, la seconde pour les oranges.


"""

# Weights and biases
w = torch.randn(2, 3, requires_grad=True)
b = torch.randn(2, requires_grad=True)
print(w)
print(b)

"""`torch.randn` crée un tenseur avec la forme donnée, avec des éléments choisis aléatoirement à partir d'une [distribution normale] (https://en.wikipedia.org/wiki/Normal_distribution) avec une moyenne de 0 et un écart-type de 1.

Notre *modèle* est simplement une fonction qui effectue une multiplication matricielle des `entrées` et des poids `w` (transposés) et ajoute le biais `b` (répliqué pour chaque observation).

![image.png](data:image/png;base64,)
"""

inputs

inputs @ w.t() + b

"""Nous pouvons définir le modèle comme suit :"""

def model(x):
    return x @ w.t() + b

"""`@` représente la multiplication matricielle dans PyTorch, et la méthode `.t` renvoie la transposée d'un tenseur.

La matrice obtenue en passant les données d'entrée dans le modèle est un ensemble de prédictions pour les variables cibles.
"""

# Generate predictions
preds = model(inputs)
print(preds)

"""Comparons les prévisions de notre modèle avec les objectifs réels."""

# Compare with targets
print(targets)

"""Vous pouvez constater une grande différence entre les prédictions de notre modèle et les cibles réelles parce que nous avons initialisé notre modèle avec des poids et des biais aléatoires. Il est évident que nous ne pouvons pas nous attendre à ce qu'un modèle initialisé de manière aléatoire fonctionne *justement*.

**Loss function**

Avant d'améliorer notre modèle, nous avons besoin d'un moyen d'évaluer ses performances. Nous pouvons comparer les prédictions du modèle avec les cibles réelles en utilisant la méthode suivante :

* Calculer la différence entre les deux
matrices (prédictions et cibles).
* Élever au carré tous les éléments de la matrice de différence pour supprimer les valeurs négatives.
* Calculer la moyenne des éléments de la matrice résultante.

Le résultat est un nombre unique, appelé le **mean squared error (MSE)**
"""

# MSE loss
def mse(t1, t2):
    diff = t1 - t2
    return torch.sum(diff * diff) / diff.numel()

"""`torch.sum` renvoie la somme de tous les éléments d'un tensor. La méthode `.numel` d'un tensor renvoie le nombre d'éléments dans un tensor.
 Calculons l'mean squared erro pour les prédictions actuelles de notre modèle.
"""

# Compute loss
loss = mse(preds, targets)
print(loss)

"""**Compute gradients**

Avec PyTorch, nous pouvons calculer automatiquement le gradient ou la dérivée de la perte par rapport aux poids et aux biais parce que la valeur de *requires_grad* est *True*. Nous verrons comment cela est utile dans un instant.
"""

# Compute gradients
loss.backward()

"""Les gradients sont stockés dans la propriété `.grad` des tenseurs respectifs. Notez que la dérivée de la perte par rapport à la matrice des poids est elle-même une matrice de même dimension."""

# Gradients for weights
print(w)
print(w.grad)

print(b)
print(b.grad)

"""**Adjust weights and biases to reduce the loss**

La loss ( perte) est une fonction quadratique de nos poids et biais, et notre objectif est de trouver l'ensemble de poids où la perte est la plus faible. Si nous traçons un graphique de la perte en fonction d'un poids ou d'un biais individuel, il ressemblera à la figure ci-dessous. Un aspect important du calcul est que le gradient indique le taux de variation de la perte, c'est-à-dire la pente de la fonction de perte par rapport aux poids et aux biais.

Si un élément du gradient est **positif** :

* une légère **augmentation** de la valeur de l'élément de poids **augmentera** la perte
* **diminuer** légèrement la valeur de l'élément de poids **diminuera** la perte.
![image.png](data:image/png;base64,)

Si un élément de gradient est **négatif** :

* une légère **augmentation** de la valeur de l'élément de poids **diminuera** la perte
* **diminuer** légèrement la valeur de l'élément de poids **augmentera** la perte.
![image.png](data:image/png;base64,)

L'augmentation ou la diminution de la perte en changeant un élément de poids est proportionnelle au gradient de la perte par rapport à cet élément. Cette observation constitue la base de l'algorithme d'optimisation par descente de gradient que nous utiliserons pour améliorer notre modèle (by descending along the gradient).

Nous pouvons soustraire de chaque élément de poids une petite quantité proportionnelle à la dérivée de la perte par rapport à cet élément afin de réduire légèrement la perte.
"""

w
w.grad

with torch.no_grad():
    w -= w.grad * 1e-5
    b -= b.grad * 1e-5

"""Nous multiplions les gradients par un très petit nombre (`10^-5` dans ce cas) pour nous assurer que nous ne modifions pas les poids de manière très importante. Nous voulons faire un petit pas dans la direction descendante du gradient, et non un pas de géant. Ce nombre est appelé le *taux d'apprentissage* de l'algorithme.

Nous utilisons `torch.no_grad` pour indiquer à PyTorch que nous ne devons pas suivre, calculer ou modifier les gradients lors de la mise à jour des poids et des biais.


"""

# Let's verify that the loss is actually lower
loss = mse(preds, targets)
print(loss)

"""Avant de continuer, nous remettons les gradients à zéro en invoquant la méthode `.zero_()`. Nous devons faire cela car PyTorch accumule les gradients. Sinon, la prochaine fois que nous invoquerons `.backward` sur la perte, les nouvelles valeurs de gradient seront ajoutées aux gradients existants, ce qui peut conduire à des résultats inattendus."""

w.grad.zero_()
b.grad.zero_()
print(w.grad)
print(b.grad)

"""**Train the model using gradient descent**

Comme nous l'avons vu plus haut, nous réduisons la perte et améliorons notre modèle à l'aide de l'algorithme d'optimisation par descente de gradient. Nous pouvons donc entraîner le modèle en suivant les étapes suivantes :

1. Générer des prédictions
2. Calcul de la perte
3. Calcul des gradients par rapport aux poids et aux biais
4. Ajuster les poids en soustrayant une petite quantité proportionnelle au gradient
5. Remettre les gradients à zéro
"""

# Generate predictions
preds = model(inputs)
print(preds)

# Calculate the loss
loss = mse(preds, targets)
print(loss)

# Compute gradients
loss.backward()
print(w.grad)
print(b.grad)

# Adjust weights & reset gradients
with torch.no_grad():
    w -= w.grad * 1e-5
    b -= b.grad * 1e-5
    w.grad.zero_()
    b.grad.zero_()

#new weights and biases
print(w)
print(b)

# Calculate loss
preds = model(inputs)
loss = mse(preds, targets)
print(loss)

"""Nous avons déjà obtenu une réduction significative de la perte en ajustant légèrement les poids et les biais à l'aide de la descente de gradient.

**Train for multiple epochs**

Pour réduire davantage la perte, nous pouvons répéter plusieurs fois le processus d'ajustement des poids et des biais à l'aide des gradients. Chaque itération s'appelle une epochs. Entraînons le modèle pendant 100 epochs.
"""

# Train for 100 epochs
for i in range(100):
    preds = model(inputs)
    loss = mse(preds, targets)
    loss.backward()
    with torch.no_grad():
        w -= w.grad * 1e-5
        b -= b.grad * 1e-5
        w.grad.zero_()
        b.grad.zero_()

"""Vérifions à nouveau que la perte est maintenant plus faible :"""

# Calculate loss
preds = model(inputs)
loss = mse(preds, targets)
print(loss)

"""La perte est maintenant bien inférieure à sa valeur initiale. Examinons les prévisions du modèle et comparons-les aux objectifs."""

# Predictions
preds

# Targets
targets

"""Les prédictions sont maintenant assez proches des variables cibles. Nous pouvons obtenir des résultats encore meilleurs en augmentant le nombre d'époques d'entraînement.

**Linear regression using PyTorch built-ins**

Nous avons implémenté un modèle de régression linéaire et de descente de gradient en utilisant quelques opérations tensors de base. Cependant, comme il s'agit d'un modèle commun dans l'apprentissage profond, PyTorch fournit plusieurs fonctions et classes intégrées pour faciliter la création et l'entraînement de modèles avec seulement quelques lignes de code.
"""

import torch.nn as nn

# Input (temp, rainfall, humidity)
inputs = np.array([[73, 67, 43],
                   [91, 88, 64],
                   [87, 134, 58],
                   [102, 43, 37],
                   [69, 96, 70],
                   [74, 66, 43],
                   [91, 87, 65],
                   [88, 134, 59],
                   [101, 44, 37],
                   [68, 96, 71],
                   [73, 66, 44],
                   [92, 87, 64],
                   [87, 135, 57],
                   [103, 43, 36],
                   [68, 97, 70]],
                  dtype='float32')

# Targets (apples, oranges)
targets = np.array([[56, 70],
                    [81, 101],
                    [119, 133],
                    [22, 37],
                    [103, 119],
                    [57, 69],
                    [80, 102],
                    [118, 132],
                    [21, 38],
                    [104, 118],
                    [57, 69],
                    [82, 100],
                    [118, 134],
                    [20, 38],
                    [102, 120]],
                   dtype='float32')

inputs = torch.from_numpy(inputs)
targets = torch.from_numpy(targets)

inputs

targets

"""**Dataset and DataLoader**

Nous allons créer un TensorDataset, qui permet d'accéder aux lignes des inputs et des targets en tant que tuples, et fournit des API standard pour travailler avec de nombreux types d'ensembles de données dans PyTorch.
"""

from torch.utils.data import TensorDataset

# Define dataset
train_ds = TensorDataset(inputs, targets)
train_ds[0:3]

"""Le `TensorDataset` nous permet d'accéder à une petite partie des données d'entraînement en utilisant la notation d'indexation de tableau (`[0:3]` dans le code ci-dessus). Il renvoie un tuple avec deux éléments. Le premier élément contient les variables d'entrée pour les lignes sélectionnées, et le second contient les targets.

Nous allons également créer un `DataLoader`, qui peut diviser les données en lots d'une taille prédéfinie pendant l'entraînement. Il fournit également d'autres utilitaires tels que le mélange et l'échantillonnage aléatoire des données.
"""

from torch.utils.data import DataLoader

# Define data loader
batch_size = 5
train_dl = DataLoader(train_ds, batch_size, shuffle=True)

for xb, yb in train_dl:
    print(xb)
    print(yb)
    break

"""A chaque itération, le data loade retourne un lot de données avec la taille de batch size. Si `shuffle` est réglé sur `True`, il mélange les données d'entraînement avant de créer les lots. Le brassage aide à randomiser l'entrée de l'algorithme d'optimisation, ce qui conduit à une réduction plus rapide de la perte.

**nn.Linear**

Au lieu d'initialiser les poids et les biais manuellement, nous pouvons définir le modèle en utilisant la classe nn.Linear de PyTorch, qui le fait automatiquement.
"""

# Define model
model = nn.Linear(3, 2)
print(model.weight)
print(model.bias)

"""Les modèles PyTorch disposent également d'une méthode utile `.parameters`, qui renvoie une liste contenant toutes les matrices de poids et de biais présentes dans le modèle. Pour notre modèle de régression linéaire, nous avons une matrice de poids et une matrice de biais."""

# Parameters
list(model.parameters())

# Generate predictions
preds = model(inputs)
preds

"""**Loss Function**

Au lieu de définir manuellement une fonction de perte, nous pouvons utiliser la fonction de perte intégrée mse_loss.
"""

# Import nn.functional
import torch.nn.functional as F

"""Le paquet `nn.functional` contient de nombreuses fonctions de perte utiles et plusieurs autres utilitaires."""

# Define loss function
loss_fn = F.mse_loss

loss = loss_fn(model(inputs), targets)
print(loss)

"""**Optimizer**

Au lieu de manipuler manuellement les poids et les biais du modèle à l'aide de gradients, nous pouvons utiliser l'optimiseur optim.SGD. SGD est l'abréviation de "stochastic gradient descent". Le terme stochastique indique que les échantillons sont sélectionnés par lots aléatoires plutôt qu'en tant que groupe unique.
"""

# Define optimizer
opt = torch.optim.SGD(model.parameters(), lr=1e-5)

"""Notez que `model.parameters()` est passé comme argument à `optim.SGD` afin que l'optimiseur sache quelles matrices doivent être modifiées pendant l'étape de mise à jour. De plus, nous pouvons spécifier un taux d'apprentissage qui contrôle la quantité par laquelle les paramètres sont modifiés.

**Train the model**

Nous sommes maintenant prêts à entraîner le modèle. Nous suivrons le même processus pour mettre en œuvre la descente de gradient :
1. Générer des prédictions
2. Calculer la perte
3. Calcul des gradients par rapport aux poids et aux biais
4. Ajuster les poids en soustrayant une petite quantité proportionnelle au gradient
5. Remettre les gradients à zéro

Le seul changement est que nous travaillerons sur des lots de données au lieu de traiter l'ensemble des données d'apprentissage à chaque itération. Définissons un ajustement de la fonction d'utilité qui entraîne le modèle pour un nombre donné d'epochs.
"""

# Utility function to train the model
def fit(num_epochs, model, loss_fn, opt, train_dl):

    # Repeat for given number of epochs
    for epoch in range(num_epochs):

        # Train with batches of data
        for xb,yb in train_dl:

            # 1. Generate predictions
            pred = model(xb)

            # 2. Calculate loss
            loss = loss_fn(pred, yb)

            # 3. Compute gradients
            loss.backward()

            # 4. Update parameters using gradients
            opt.step()

            # 5. Reset the gradients to zero
            opt.zero_grad()

        # Print the progress
        if (epoch+1) % 10 == 0:
            print('Epoch [{}/{}], Loss: {:.4f}'.format(epoch+1, num_epochs, loss.item()))

"""Quelques points à noter ci-dessus :

* Nous utilisons le data loader défini précédemment pour obtenir des lots de données pour chaque itération.

* Au lieu de mettre à jour les paramètres (poids et biais) manuellement, nous utilisons `opt.step` pour effectuer la mise à jour et `opt.zero_grad` pour remettre les gradients à zéro.

* Nous avons également ajouté une déclaration de journal qui imprime la perte du dernier lot de données pour chaque 10ème epoch afin de suivre la progression de l'apprentissage. `loss.item` renvoie la valeur réelle stockée dans le tensor de perte.

Entraînons le modèle pour 100 epochs.


"""

fit(100, model, loss_fn, opt, train_dl)

# Generate predictions
preds = model(inputs)
preds

# Compare with targets
targets

